var tipuesearch = {"pages": [{'title': 'About', 'text': '國立虎尾科技大學機械設計工程系 \n National Formosa University \n Department of Mechanical Design Engineering \n cad2024 電腦輔助設計與實習 \n 課程教材: \n Intro_to_Mechatronics.pdf  ( Source ) \n Programming with Python for Engineers \n NX Tutorial \n cd2023_pj3ag4_zmq_football_4.7.7z \n cd2024_2b_g6_steel_ball_platform_nxopen_copsim.7z \n Teams 線上教學： \n 以 "學號@nfu.edu.tw" 登入  https://login.microsoftonline.com/  Office 365 \n Teams 團隊代碼:\xa07pg9z7u \n 個人倉儲: https://github.com/mdecad2024/hw-41223136 \xa0 \n 個人網站: https://mdecad2024.github.io/hw-41223136/ \xa0 \n 其他資訊 \n 攜帶耳機、隨身碟(USB 3.0, 32 GB 以上) \n', 'tags': '', 'url': 'About.html'}, {'title': 'Attendance', 'text': '出席 (10%) - 自行舉證評分 \n 自行利用 Github commits 提交記錄評分.imde \n', 'tags': '', 'url': 'Attendance.html'}, {'title': 'w1', 'text': '利用github提供的 Codespaces和近端，維護個人的倉儲，而本週課程結束前，有提到需將本週影片：利用 Codespaces 維護個人的作業網站，以下是將老師影片上字幕的影片: \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2', 'text': '複習使用 Codespaces來維護個人網站，後面提到如何架設近端來維護個人倉儲 \n 以下是老師所教的如何架設近端來維護個人倉儲: \n \n 課程後有提到 \n git add . \n git commit -m "輸入上傳的內容" \n git push \n 也可以用最快速的上傳方法 \n ./acp "輸入上傳的內容" \n acp的意思就是把 git add、git commit和git push結合在一起 \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '課堂利用CoppeliaSim導入Solvespace圖檔 \n 課後練習將圖檔導入CoppeliaSim \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w6', 'text': 'https://mdecad2024.github.io/hw-41223136/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223136/41223136_part1.stl \n \n \n \n    可以添加更多的 canvas  \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n \n \n 如何將圖檔放在s104.cycu.org上: \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'first', 'text': 'https://mdecad2024.github.io/hw-41223136/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223136/41223136_part2.stl \n \n \n \n    可以添加更多的 canvas  \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n \n', 'tags': '', 'url': 'first.html'}, {'title': 'second', 'text': 'https://mdecad2024.github.io/hw-41223136/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223136/41223136_part3.stl \n \n \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n \n', 'tags': '', 'url': 'second.html'}, {'title': 'third', 'text': 'https://mdecad2024.github.io/hw-41223136/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223136/41223136_part4.stl \n \n \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n \n', 'tags': '', 'url': 'third.html'}, {'title': 'W7上課內容', 'text': '\n 配合ZoomIt64和sharex錄製，使用ZoomIt64時可以按Ctrl+1可以放大部分畫面。 \n 使用hybrid利用本機的固態硬碟開啟NX 目的是解決NX開啟的時間，由固態硬碟開啟NX 將此檔 cad2024_w2_hybrid_download_and_start_batch.7z 下載並解壓縮即可 \n \n \n', 'tags': '', 'url': 'W7上課內容.html'}, {'title': 'w9', 'text': '評分自己的倉儲、網站，打個人期中成績，並寫自評表表單 \n \n', 'tags': '', 'url': 'w9.html'}, {'title': 'w11_hw', 'text': '本周需將 flipper_nx2312.7z 檔案下載，分別以NX、solvespace 繪製其中的： \n Plongeur Batteur_sldprt.prt \n Piece composite_sldprt.prt \n Piece métalique gauche_sldprt.prt \n Plastique Flipper_sldprt.prt \n Support Bobine_sldprt.prt \n Platine Batteur_sldprt.prt \n Flipper_sldprt.prt \n 繪製檔案後轉為stl檔至 CoppeliaSim組合並試者模擬使其轉動 。 \n 內容過程為三人一組製作，我的部分是： \n Platine Batteur_sldprt.prt \n \n  只保留一个 canvas    \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n 分組組員有:41223118、41223134 \n 我負責的部分 \n Platine Batteur_sldprt.7z \n \n 其他組員繪製過程請至 41223118 和 41223134 觀看 \n ------------------------------------------------- \n 以下是自我練習的部分 \n Plongeur Batteur_sldprt.7z \n \n', 'tags': '', 'url': 'w11_hw.html'}, {'title': 'stl', 'text': '\n \n  只保留一个 canvas    \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n', 'tags': '', 'url': 'stl.html'}, {'title': 'w12_ch', 'text': '抽查w7、w10、w11_hw的頁面進度 \n 介紹solvespace功能及組合零件的技巧 \n 分配零件已完成可至 w11 查看 \n 其餘零件可至 41223118 和 41223134 查看 \n', 'tags': '', 'url': 'w12_ch.html'}, {'title': 'w13', 'text': '本週提到如何用NX進行組配，也提到CoppeliaSim進行零件轉動過程，影片如下： \n 檔案 NX2312:41223136 \n NX進行組配 \n \n \n \n \n  只保留一个 canvas    \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n \n \n 檔案 CoppeliaSim:41223136 \n CoppeliaSim進行轉動 \n \n \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '本週進度從在\xa0solvespace 組配組立件到使用\xa0CoppeliaSim 模擬彈珠彈跳至下載配合使用\xa0pyzmq、cbor 與 keyboard 模組利用 Python 程式控制組立件左右擺動。 \n ---------------------------------------------------------------------------------------------- \n 以下是操作影片： \n 1.利用STL 檔案 建立 CoppeliaSim 模擬場景 的過程 \n 檔案： coppeliasim_zmqremoteapi_client.ttt \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0  連桿件.stl \n \n 2. 利用 Solvespace 進行零件組立的過程 \n 檔案： flipper_in_solvespace_cw_and_ccw.7z \n \n \n  只保留一个 canvas    \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n', 'tags': '', 'url': 'w14.html'}, {'title': 'w15', 'text': '', 'tags': '', 'url': 'w15.html'}, {'title': 'cmsimde', 'text': "SMap  - SiteMap - 依照階次列出網站的所有頁面. \n EditA  - Edit All page - 將所有頁面放入編輯模式中, 主要用來處理頁面搬遷, 刪除或決定衝突頁面內容版本. \n Edit  - Edit page - 先選擇要編輯的單一頁面後, 再點選 Edit, 即可進入單一頁面的編輯模式. \n Config  - Configure Site - 編輯頁面標題與管理者密碼. \n Search  - 動態頁面內容的關鍵字搜尋. \n IUpload  - Image file Upload - 圖檔的上傳功能, 可以上傳 jpg, png 與 gif 檔案, 其中若在手機上傳圖檔, 系統會自動將圖片檔案縮小為 800x800 大小. \n IList  - Image file List - 列出可以直接在頁面編輯模式中引用的圖片檔案. \n FUpload  - File Upload - 一般檔案的上傳功能, 目前可以上傳的檔案副檔名包括 'jpg', 'png', 'gif', '7z', 'pdf', 'zip', 'ttt', 'stl', 'txt', 'html', 'mp4' 等, 使用者可以自行修改. \n FList  - File List - 列出可以直接在頁面編輯模式中引用的上傳檔案. \n Logout  - 登出頁面編輯模式. \n Convert  - 將動態網站中位於 config/content.htm 檔案, 透過分頁設定轉為 content 目錄中的靜態網頁. \n acp  - git add, git commit 與 git push, 通常只有在 localhost 或自架主機上利用網頁表單協助將倉儲改版內容推向 Github 倉儲. \n SStatic  - Start Static Site - 利用 Python 啟動網站伺服功能, 可以讓使用者檢查轉檔後的靜態網站內容. \n RStatic  - Replit Static Site URL - 僅用於 Replit 模式, 當使用者按下 SStatic 後, 可以按下 RStatic 進入當下尚未推向 Github Pages 的靜態網站. \n 80  - 由 init.py 中 static_port 所決定的連結字串, 一般不使用 80, 只有在 Replit 中為了與動態網站共用 port, 才特別設為 80. \n", 'tags': '', 'url': 'cmsimde.html'}, {'title': 'w7', 'text': '觀看影片請往 這邊 進行觀看 \n \n  动态生成 13 个 canvas                          \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n \n \n 繪圖檔案 \n 檔案內有slvs檔和stl檔 \n part1 \xa0 part2 \n part3 \xa0 part4 \n part5 \xa0 part6 \n part7 \xa0 part8 \n part9 \xa0 part10 \n part11 \xa0 part12 \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'HW1', 'text': 'Homework 1 (10%): \n 利用 Solvespace 與 NX2312 建立  Parts  頁面中的零件 \n 其他 零件模擬練習 \n \n 利用 Solvespace 繪製列表中零件的操作過程與說明影片如下: \n \n cad hw1.7z \n 利用 Solvespace 繪製列表中零件的操作過程與說明影片如下: \n \n 41223136_part2.7z \n 利用 NX2312 繪製列表中零件的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業一之三 \n 所完成的零件檔案下載 \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業一之四 \n 所完成的零件檔案下載 \n ...... \n HW1 執行心得: \n ...... \n HW1 自評分數: \n 完成上述流程後, 請將 HW1 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'HW1_Exam', 'text': '從 零件模擬練習 中選出零件, 隨堂進行考試. \n 零件考試題目以 Solvespace 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件檔案下載 \n 零件考試題目以 NX2312 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件檔案下載 \n', 'tags': '', 'url': 'HW1_Exam.html'}, {'title': 'w10', 'text': '進行隨堂考試，並將錄製影片，開頭需要有自己的網站。 \n \n \n \n 題目一、題目二 \n \n      可以添加更多的 canvas  \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n', 'tags': '', 'url': 'w10.html'}, {'title': '其他影片內容', 'text': 'demo 倉儲:  https://github.com/mdecad2024/hw-41223136 \n 利用靜態認證檔案, 加快作業網站編輯流程 \n \n NX2312 啟動設定: \n REM for NX2312, must after path setup \nset SPLM_LICENSE_SERVER=29000@認證主機\nset UGII_LANG=english\nset UGS_LICENSE_BUNDLE=ACD11,ACD10\nset UGII_BASE_DIR=%Disk%:\\NX\\\nset UGII_TMP_DIR=%Disk%:\\NX\\temp\nset UGII_LIB_PATH=%Disk%:\\NX\\NXBIN\\python\nset ugii=%Disk%:\\NX\\ugii;%Disk%:\\NX\\nxbin;\npath = %ugii%;%path%\nXcopy %Disk%:\\home_ipv6\\AppData\\Local\\Siemens\\NX2312 C:\\users\\%USERNAME%\\AppData\\Local\\Siemens\\NX2312 /E /H /C /I /Y\n \nREM 決定是否開啟 nx GUI 介面\nREM start ugraf -nx\n \nREM 以下指令可以直接呼叫 NXOpen Python 程式進行繪圖組立與其他相關流程\npython %Disk%:\\tmp\\nx_ex\\new_part.py \n', 'tags': '', 'url': '其他影片內容.html'}, {'title': 'HW2', 'text': 'Homework 2 (10%): \n 利用 Solvespace 與 NX 建立  Balance on Wheels  組立件 \n \n 利用 Solvespace 繪製  Balance on Wheels  組立件的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業二之一 \n 所完成的零組件檔案下載 \n 利用 NX2312 繪製  Balance on Wheels  組立件的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業二之二 \n 所完成的零件檔案下載 \n HW2 執行心得: \n ...... \n HW2 自評分數: \n 完成上述流程後, 請將 HW2 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW2_Exam', 'text': '與 HW2 內容相近的組立件題目, 隨堂進行考試. \n 零件與組立件考試題目以 Solvespace 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件與組立件檔案下載 \n 零件與組立件考試題目以 NX 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件與組立件檔案下載 \n', 'tags': '', 'url': 'HW2_Exam.html'}, {'title': 'w16_exam1', 'text': 'Solvespace零件繪圖：將量測的尺寸小數點後兩位改為自己的學號最後兩碼(36)，再以Solvespace進行組配，將過程錄製為影片，並將檔案設為"學號_w16_exam1.7z" \n 檔案內皆有slvs、stl、尺寸圖表檔案 \n 檔案下載： 41223136_w16_exam1.7z \n 操作影片-零件1： \n \n 操作影片-零件2： \n \n 操作影片-Solvespace組配： \n', 'tags': '', 'url': 'w16_exam1.html'}, {'title': 'HW3', 'text': 'Homework 3 (20%): \n 建立  Balance on Wheels  控制系統設計模擬場景 \n https://github.com/mdecycu/Balance_On_Wheels \n \n \n Balance_on_wheels_nx2312.7z \n Balance_on_Wheel_scene.7z \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'HW3_Exam', 'text': '與 HW3 內容相近的模擬場景題目, 隨堂進行考試. \n 建立模擬場景操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的模擬場景與控制程式檔案下載 \n \n 利用 CoppeliaSim 建立  Balance on Wheels  控制系統設計模擬場景的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業三 \n 請將操作影片嵌入 ...... \n 所完成的場景與控制程式檔案下載 \n HW3 執行心得: \n ...... \n HW3 自評分數: \n 完成上述流程後, 請將 HW3 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW3_Exam.html'}, {'title': 'w16_exam2', 'text': 'NX2312零件繪圖：將量測的尺寸小數點後兩位改為自己的學號最後兩碼(36)，再以Solvespace進行組配，將過程錄製為影片，並將檔案設為"學號_w16_exam2.7z" \n 檔案內皆有slvs、stl、尺寸圖表檔案 \n 檔案下載： 41223136_w16_exam2.7z \n 操作影片-零件1： \n \n 操作影片-零件2： \n \n 操作影片-NX2312組配 \n', 'tags': '', 'url': 'w16_exam2.html'}, {'title': 'HW4', 'text': 'Homework 4 (20%): \n 建立  Dingo 機器狗 控制系統設計模擬場景 \n https://github.com/mdecycu/DingoQuadruped \n DINGO_QUADRUPED_CAD.7z \n \n \n 利用 CoppeliaSim 建立  Dingo 機器狗 控制系統設計模擬場景的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業四 \n 所完成的場景與控制程式檔案下載 \n HW4 執行心得: \n .... \n HW4 自評分數: \n 完成上述流程後, 請將 HW4 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW4.html'}, {'title': 'HW4_Exam', 'text': '與 HW4 內容相近的模擬場景題目, 隨堂進行考試. \n 建立模擬場景操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的模擬場景與控制程式檔案下載 \n \n \n', 'tags': '', 'url': 'HW4_Exam.html'}, {'title': 'Solvespace practise', 'text': 'part3 \n \n part4 \n \n part5 \n \n part6 \n \n part7 \n \n part8 \n \n part9 \n \n part10 \n \n part11 \n part12 \n', 'tags': '', 'url': 'Solvespace practise.html'}, {'title': 'Solvespace picture file', 'text': 'part1   part2 \n part3   part4 \n part5   part6 \n part7 \xa0 part8 \n part9 \xa0 part10 \n part11 \xa0 part12 \n', 'tags': '', 'url': 'Solvespace picture file.html'}, {'title': 'Final Report', 'text': '期末口頭與書面專題報告 (30%) \n 期末口頭專題報告影片: \n ...... \n 期末書面專題報告檔案 (pdf): \n ...... \n 電腦輔助設計與實習課程總結心得: \n ...... \n 期末報告自評成績: \n 完成上述流程後, 請將 Final Report 自評分數輸入 cad2024 自評表單中.', 'tags': '', 'url': 'Final Report.html'}]};